import React, { useState, useEffect } from "react";

function Details() {
  useEffect(() => {
    fetchItems();
  }, []);

  const [items, setItems] = useState([]);

  const fetchItems = async () => {
    const data = await fetch(
      "https://challenge.lexicondigital.com.au/api/cinemaworld/movies",
      { headers: { "x-api-key": "Yr2636E6BTD3UCdleMkf7UEdqKnd9n361TQL9An7" } }
    );

    const returnedItems = await data.json();
    console.log(returnedItems.Movies);
    setItems(returnedItems.Movies);
  };

  console.log(items);

  return (
    <div>
      {items.Movies.map((item) => (
        <h1>{item.Title}</h1>
      ))}
    </div>
  );
}

export default Details;
